    // src/pages/AdicionarHorarios.js

import React, { useState } from 'react';
import { Form, Button } from 'react-bootstrap';

function AdicionarHorarios() {
    const [data, setData] = useState('');
    const [horaInicio, setHoraInicio] = useState('');
    const [horaFim, setHoraFim] = useState('');

    const handleSubmit = (e) => {
        e.preventDefault();
        // Aqui você pode implementar a lógica para adicionar horários
        console.log({ data, horaInicio, horaFim });
        // Limpar os campos após o envio
        setData('');
        setHoraInicio('');
        setHoraFim('');
    };

    return (
        <div>
            <h3>Adicionar Horários</h3>
            <Form onSubmit={handleSubmit}>
                <Form.Group controlId="formData">
                    <Form.Label>Data</Form.Label>
                    <Form.Control
                        type="date"
                        value={data}
                        onChange={(e) => setData(e.target.value)}
                        required
                    />
                </Form.Group>

                <Form.Group controlId="formHoraInicio">
                    <Form.Label>Hora de Início</Form.Label>
                    <Form.Control
                        type="time"
                        value={horaInicio}
                        onChange={(e) => setHoraInicio(e.target.value)}
                        required
                    />
                </Form.Group>

                <Form.Group controlId="formHoraFim">
                    <Form.Label>Hora de Fim</Form.Label>
                    <Form.Control
                        type="time"
                        value={horaFim}
                        onChange={(e) => setHoraFim(e.target.value)}
                        required
                    />
                </Form.Group>

                <Button variant="primary" type="submit">
                    Adicionar Horário
                </Button>
            </Form>
        </div>
    );
}

export default AdicionarHorarios;
